pragma solidity ^0.4.15;
import './SafeMath.sol';
import './Owner.sol';
import './Watt.sol';
import './Token.sol';


contract ModelS is SafeMath , Owner{
	address public watt;
    address public tsl;
    uint public oneWatt;
    uint accountCount;
    uint allowanceLimit;
    uint lastBlock;
    uint delta;
    uint tslPerWatt;
    mapping (uint => address) accounts;
    event Tick(address indexed _sender, uint256 _amount, uint256 _value);

    function ModelS(address _watt, address _tsl, uint _allowanceLimit, uint _delta, uint _tslPerWatt) {
        oneWatt = 1;
        uint d = Token(_watt).decimals();
        for (uint8 i=0;i<d;++i) oneWatt *= 10;
        tsl = _tsl;
        watt = _watt;
        accountCount = 0;
        allowanceLimit = _allowanceLimit;
        lastBlock = block.timestamp;
        delta = _delta;
        tslPerWatt = _tslPerWatt;
    }

    function register(address _account) {
        if (Token(tsl).allowance(_account, this) < allowanceLimit) revert();
        accounts[accountCount] = _account;
        accountCount += 1;
    }

    function tick() onlyOwner {
        if ((block.timestamp - lastBlock) < delta) revert();
        uint totalValue = 0;
        for (uint i=0; i < accountCount; ++i) {
            uint256 wattBalance = Token(watt).balanceOf(accounts[i]);
            if (wattBalance == 0) continue;
            uint256 amount = safeMul(block.timestamp - lastBlock, safeMul(wattBalance, tslPerWatt)) / safeMul(oneWatt, delta);
            uint256 tslBalance = Token(tsl).balanceOf(accounts[i]);
            if (tslBalance < amount) amount = tslBalance;
            if (!Token(tsl).transfer(msg.sender, amount) ) continue;
            totalValue += amount;
        }
        lastBlock = block.timestamp;
        Tick(msg.sender, accountCount, totalValue);
    }
}
